import React from "react";
import { Button } from "react-bootstrap";

export default function UserProfile({ name, address, dob }) {
  return (
    <div>
      <h2>Profile</h2>
      <hr />
      <p>Name: {name}</p>
      <p>Address: {address}</p>
      <p>Date of Birth: {dob}</p>
      <Button>Update</Button>
    </div>
  );
}
